import React from 'react';
import { Container, Grid, Typography, Card, CardMedia, CardActionArea } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const bodyTypes = [
  { type: 'Ectomorph', image: '/assets/ectomorph.jpg' },
  { type: 'Mesomorph', image: '/assets/mesomorph.jpg' },
  { type: 'Endomorph', image: '/assets/endomorph.jpg' }
];

const BodyTypeSelection: React.FC = () => {
  const navigate = useNavigate();

  const handleSelection = (type: string) => {
    navigate(`/program/${type}`);
  };

  return (
    <Container>
      <Typography variant="h4" component="h1" gutterBottom>
        Select Your Body Type
      </Typography>
      <Grid container spacing={4}>
        {bodyTypes.map((bodyType) => (
          <Grid item xs={12} sm={6} md={4} key={bodyType.type}>
            <Card>
              <CardActionArea onClick={() => handleSelection(bodyType.type)}>
                <CardMedia
                  component="img"
                  alt={bodyType.type}
                  height="300"
                  image={bodyType.image}
                  title={bodyType.type}
                />
                <Typography variant="h6" component="h2" gutterBottom>
                  {bodyType.type}
                </Typography>
              </CardActionArea>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default BodyTypeSelection;
